function KeyFilter(event) {
	var key = event.keyCode;
	if(key==87) { WPressed(); }
	if(key==65) { APressed(); }
	if(key==83) { SPressed(); }
	if(key==68) { DPressed(); }
	if(key==32) { SPACEPressed(); }
}

function WPressed() { console.log("key pressed : W"); }
function APressed() { console.log("key pressed : A"); }
function SPressed() { console.log("key pressed : S"); }
function DPressed() { console.log("key pressed : D"); }
function SPACEPressed() { 
console.log("key pressed : SPACE");
var playerYPos = player.YPos;
console.log("Checking playerYPos : "+playerYPos);
var YPosStr = playerYPos.replace("px",'');
var YPosNum = Number(YPosStr);
console.log("Checking if YPosNum is number : "+YPosNum);
var NewYPos = YPosNum - player.Force;
document.getElementById("player").style.top = NewYPos;
}
function Setup_JSON() {
	var Level_Layout_JSON = "https://rawgit.com/Rexoid/JavaScript/master/Level_Layout.json?nocache"+(new Date()).getTime();
	var request_Layout = new XMLHttpRequest();
	request_Layout.open("GET", Level_Layout_JSON);
	request_Layout.responseType = "json";
	request_Layout.send();
	request_Layout.onload = function() {
		console.log("Checking JSON response : "+request_Layout.response);
		Check_Active(request_Layout.response);
	}
}

player = {
	XPos : "0px",
	XVolocity : 0,
	YPos : "0px",
	YVolocity : 0,
	Force : 10,
	Gravity : 0.5,
	width : 10,
	height: 10,
	id : "player"
}

window.addEventListener("load", function(){
	Setup_JSON();
});
